import axios from "axios";
import React from "react";
import { Pie } from "react-chartjs-2";



// defaults.global.tooltips.enabled = false
// defaults.global.legend.position = 'bottom'

const Chart = ({ login , isAuthenticated }) => async => {
  // const [ firstdose , setFirstdose ] = useState([]);
  // const [ seconddose, setseconddose] = useState([]);
  // const [ both , setbothdose] = useState([]);
  // const[notboth , setnotboth] = useState([]);

  if (localStorage.getItem("token")) {
    const config = {
      headers: {
        "Content-Type": "application/json",
        Authorization: `token ${localStorage.getItem("token")}`,
        Accept: "application/json",
      },
    };

    const res =  axios.get(
        `http://127.0.0.1:8000/accounts/count/`,
        config
      );

    console.log(res)
    let employees = []
    let datas = []

    console.log(employees.push(res.data.employees))
    datas.push(res.data.FD)

  }


  return (
    <div>
      <Pie
        data={{
          labels: ["Red", "Blue", "Yellow", "Green", "Purple", "Orange"],
          datasets: [
            {
              label: "# of votes",
              data: [12, 19, 3, 5, 2, 3],
              backgroundColor: [
                "rgba(255, 99, 132, 0.2)",
                "rgba(54, 162, 235, 0.2)",
                "rgba(255, 206, 86, 0.2)",
                "rgba(75, 192, 192, 0.2)",
                "rgba(153, 102, 255, 0.2)",
                "rgba(255, 159, 64, 0.2)",
              ],
              borderColor: [
                "rgba(255, 99, 132, 1)",
                "rgba(54, 162, 235, 1)",
                "rgba(255, 206, 86, 1)",
                "rgba(75, 192, 192, 1)",
                "rgba(153, 102, 255, 1)",
                "rgba(255, 159, 64, 1)",
              ],
              borderWidth: 1,
            },
            // {
            //   label: 'Quantity',
            //   data: [47, 52, 67, 58, 9, 50],
            //   backgroundColor: 'orange',
            //   borderColor: 'red',
            // },
          ],
        }}
        height={400}
        width={600}
        options={{
          maintainAspectRatio: false,
          scales: {
            yAxes: [
              {
                ticks: {
                  beginAtZero: true,
                },
              },
            ],
          },
          legend: {
            labels: {
              fontSize: 25,
            },
          },
        }}
      />
    </div>
  );
};

export default Chart
